import React from "react";
import Contact from "./Contact";
import About from "./About";
import { BrowserRouter } from "react-router-dom";
import { Route, Switch } from "react-router-dom";

const Navbar = () => {
  return (
    <>
      <BrowserRouter>
        <Switch>
          <Contact />
          <About />
        </Switch>
      </BrowserRouter>
    </>
  );
};

export default Navbar;
